using System;using HECSFramework.Core;using Newtonsoft.Json;using HECSFramework.Serialize;namespace HECSFramework.Serialize{	[JsonObject, Serializable]	public partial struct CheckThrowResolverJSONResolver : IJSONResolver<CheckThrowResolver,CheckThrowResolverJSONResolver>	{		[JsonProperty("T1")]		public int T1;		[JsonProperty("T2")]		public int T2;		public CheckThrowResolverJSONResolver In(ref CheckThrowResolver checkthrowresolver)		{			this.T1 = checkthrowresolver.T1;			this.T2 = checkthrowresolver.T2;			return this;		}		public void Out(ref CheckThrowResolver checkthrowresolver)		{			checkthrowresolver.T1 = this.T1;			checkthrowresolver.T2 = this.T2;		}	}}